import { useParams } from "react-router-dom";
import CarDetails from '../CarDetails';

function BlogDetails() {
    let params = useParams();
    console.log(params);
    let cc = CarDetails[params.id];
    return (
        <div>
            <p>{cc.CarMake}</p>
        </div>
    );
}

export default BlogDetails;
